CREATE DEFINER=`root`@`localhost` PROCEDURE `calculate_indicators_confidence_and_calls`()
BEGIN

delete from  engine_indicators.rsi_evaluation_run_current_data where curr_signal = 0;

delete from  engine_indicators.stochastic_evaluation_run_current_data where curr_signal = 0;

delete from  engine_indicators.obv_evaluation_run_current_data where curr_signal = 0;



call engine_indicators.calculate_rsi_confidence();

call engine_indicators.calculate_stochastic_confidence();

call engine_indicators.calculate_obv_confidence();


call engine_indicators.generate_rsi_calls();

call engine_indicators.generate_stochastic_calls();

call engine_indicators.generate_obv_calls();


END ;;
