CREATE DEFINER=`root`@`localhost` PROCEDURE `calc_obv_confidence_by_symbol`(
input_symbol varchar(45),
input_obv_evaluation_run_id int,
input_date date)
BEGIN

   -- Declare variables used just for cursor and loop control
  DECLARE no_more_rows int;
  DECLARE num_rows INT DEFAULT 0;

    DECLARE loop_counter_one_day INT DEFAULT 0;

    DECLARE loop_counter_three_day INT DEFAULT 0;


      DECLARE var_curr_signal int DEFAULT 0;


    DECLARE var_curr_date date;

    DECLARE var_curr_avg_price float DEFAULT 0;

   DECLARE var_curr_sr_no int DEFAULT 0;


    DECLARE var_target_date date DEFAULT 0;

    DECLARE var_target_avg_price float DEFAULT 0;

    DECLARE var_one_day_current_confidence float DEFAULT 0;

    DECLARE var_three_day_current_confidence float DEFAULT 0;

    DECLARE var_one_day_total_confidence float DEFAULT 0;

    DECLARE var_three_day_total_confidence float DEFAULT 0;

    DECLARE var_one_day_avg_confidence float DEFAULT 0;

    DECLARE var_three_day_avg_confidence float DEFAULT 0;

    DECLARE var_one_day_success_counter INT DEFAULT 0;

    DECLARE var_three_day_success_counter INT DEFAULT 0;

    DECLARE var_one_day_success_confidence float DEFAULT 0;

    DECLARE var_three_day_success_confidence float DEFAULT 0;






    DECLARE obv_backtest_data CURSOR FOR
    SELECT DISTINCT
        DATE_FORMAT(curr_date,'%Y-%m-%d'),curr_signal
    FROM engine_indicators.obv_evaluation_run_backtest_data
    where symbol = input_symbol
    -- ORDER BY curr_date ASC
;

  -- Declare 'handlers' for exceptions
  DECLARE CONTINUE HANDLER FOR NOT FOUND
    SET no_more_rows = 1;

 OPEN obv_backtest_data;



rally_loop : LOOP

 IF no_more_rows = 1 THEN
 LEAVE rally_loop;
 END IF;



FETCH obv_backtest_data INTO var_curr_date,var_curr_signal;

 IF no_more_rows = 1 THEN
 LEAVE rally_loop;
 END IF;


-- calculation for 1 day

select a.SR_NO from engine_ea.market_sessions a
where    a.SESSION_DATE =   var_curr_date
into var_curr_sr_no;

select a.SESSION_DATE from engine_ea.market_sessions a
where    a.SR_NO =   var_curr_sr_no + 1
into var_target_date;

select a.AVERAGE_PRICE from   engine_ea.equity_data_main a
where a.CURR_DATE =  var_curr_date
and symbol = input_symbol
into var_curr_avg_price;

select a.AVERAGE_PRICE from   engine_ea.equity_data_main a
where a.CURR_DATE =  var_target_date
and symbol = input_symbol
into var_target_avg_price;

set var_one_day_current_confidence =  ((var_target_avg_price-var_curr_avg_price)
                                    * 100 * 100 * var_curr_signal/(0.5*var_curr_avg_price));

if( var_one_day_current_confidence >= 100) then
set var_one_day_success_counter = var_one_day_success_counter + 1;
end if;

if( var_one_day_current_confidence is not null) then

set var_one_day_total_confidence = var_one_day_total_confidence +
                                    var_one_day_current_confidence;

end if;

update engine_indicators.obv_evaluation_run_backtest_data a
set a.one_day_confidence_value = var_one_day_current_confidence
where a.symbol = input_symbol
and a.curr_date =  var_curr_date;

-- calculation for 1 day


-- calculation for 3 days


select a.SESSION_DATE from engine_ea.market_sessions a
where    a.SR_NO =   var_curr_sr_no + 3
into var_target_date;

if(var_curr_signal = 1) then
select max(a.AVERAGE_PRICE) from   engine_ea.equity_data_main a
where 1=1
and symbol = input_symbol
and a.CURR_DATE >  var_curr_date
and a.CURR_DATE <=  var_target_date
into var_target_avg_price;

else if(var_curr_signal = -1) then

select min(a.AVERAGE_PRICE) from   engine_ea.equity_data_main a
where 1=1
and symbol = input_symbol
and a.CURR_DATE >  var_curr_date
and a.CURR_DATE <=  var_target_date
into var_target_avg_price;

end if;
end if;

set var_three_day_current_confidence =  ((var_target_avg_price-var_curr_avg_price)
                                   * 100 * 100 * var_curr_signal/var_curr_avg_price);

if( var_three_day_current_confidence >= 100) then
set var_three_day_success_counter = var_one_day_success_counter + 1;
end if;

if( var_three_day_current_confidence is not null) then

set var_three_day_total_confidence = var_three_day_total_confidence +
                                   var_three_day_current_confidence;

end if;

update engine_indicators.obv_evaluation_run_backtest_data a
set a.three_day_confidence_value =  var_three_day_current_confidence
where a.symbol = input_symbol
and a.curr_date =  var_curr_date;

-- calculation for 3 days


if(var_one_day_current_confidence is not null) then
set loop_counter_one_day = loop_counter_one_day + 1;
end if;

if(var_three_day_current_confidence is not null) then
set loop_counter_three_day = loop_counter_three_day + 1;
end if;

end loop  rally_loop;

if (loop_counter_one_day > 0) then

set var_one_day_avg_confidence = var_one_day_total_confidence / loop_counter_one_day;

set var_one_day_success_confidence = var_one_day_success_counter /  loop_counter_one_day;

end if;

if (loop_counter_three_day > 0) then

set var_three_day_success_confidence = var_three_day_success_counter /  loop_counter_three_day;

set var_three_day_avg_confidence = var_three_day_total_confidence / loop_counter_three_day;

end if;

if (input_date is not null) then

replace into engine_indicators.obv_backtest_confidence
values(input_obv_evaluation_run_id,input_symbol,input_date,var_one_day_avg_confidence,
                              var_three_day_avg_confidence,
                                    var_one_day_success_confidence,var_three_day_success_confidence);

end if;


update  engine_indicators.obv_evaluation_run_current_data
set  one_day_avg_confidence = var_one_day_avg_confidence,
three_day_avg_confidence = var_three_day_avg_confidence,
one_day_success_confidence = var_one_day_success_confidence,
three_day_success_confidence = var_three_day_success_confidence

where obv_evaluation_run_id = input_obv_evaluation_run_id
and symbol = input_symbol;


close obv_backtest_data;

END ;;
